import React from 'react';

function Card({ movie }) {
  const IMAGE_URL = 'https://image.tmdb.org/t/p/w500';

  return (
    <div className="card">
      <img src={`${IMAGE_URL}${movie.poster_path}`} alt={movie.title} />
      <h3>{movie.title}</h3>
      <p>Rating: {movie.vote_average}</p>
    </div>
  );
}

export default Card;
